import React from "react";
import { View, Text, TouchableOpacity } from "react-native";
import HomeStyle from "./styles/HomeStyle.js";

class Home extends React.Component {
    render() {
        return (
            <View style={HomeStyle.Iphone_11_Pro_Max}>
                <View style={HomeStyle.topinfo}>
                    <View style={HomeStyle.Khung}>
                        <Text style={HomeStyle.h1}>Acne Checker</Text>
                    </View>
                    <View style={HomeStyle.buttonmenu}>
                        <View style={HomeStyle.option}>
                            <TouchableOpacity>
                                <View style={HomeStyle.rectangle}>
                                    <Text>
                                        <i className='bx bx-search-alt'></i>
                                    </Text>
                                </View>
                            </TouchableOpacity>
                        </View>
                    </View>
                </View>
            </View>
        );
    }
}

export default Home;
